function Dashboard () {

  return(
    <div>
      {/* <img src="" alt="" srcset="" /> */}

      <h1>About Me</h1>
      <p>Hi, I am Madhavi, and I'm passionate about building the websites. I have started volunteering as a Digital Hub tutor in the library helping many people to navigate computers and mobile phones. That led me to learn software engineering.  </p>
      <p>Lately, I've discovered my passion for the world of web development and the beauty behind building useful websites like the one you will find in this portfolio. I'm now looking for a junior dev position to finally kick start my career and learn among professionals.</p>



    </div>
  )


}

export default Dashboard;
